import com.google.common.collect.HashBiMap;
import com.google.common.collect.HashMultimap;
import java.util.HashMap;
import java.util.Map;

public class Main {
    public static void main(String[] args) {
        HashBiMap<String, Integer> biMap = HashBiMap.create();
        HashMultimap<String, String> multiMap = HashMultimap.create();
        Map<String, Integer> hashMap = new HashMap<>();

        // Adding elements to a HashMultimap
        multiMap.put("fruit", "apple");
        multiMap.put("fruit", "banana");
        multiMap.put("vegetable", "carrot");

        // Adding elements to a HashMap
        hashMap.put("A", 1);
        hashMap.put("B", 2);
        hashMap.put("C", 3);

        // Operations on HashMap
        for (Map.Entry<String, Integer> entry : hashMap.entrySet()) {
            System.out.println(entry.getKey() + ": " + entry.getValue());
        }

        // Operations on HashMultimap
        System.out.println("Fruits: " + multiMap.get("fruit"));
        System.out.println("Vegetables: " + multiMap.get("vegetable"));

        // Using HashBiMap
        /* write */ biMap.put("key", 42);

        // More operations on HashMultimap
        multiMap.put("fruit", "orange");
        multiMap.put("vegetable", "broccoli");

        // Operations on HashMap
        hashMap.put("D", 4);
        hashMap.put("E", 5);

        // More operations on HashBiMap
        biMap.put("anotherKey", 84);

        // Operations on HashMap
        for (String key : hashMap.keySet()) {
            System.out.println("HashMap Key: " + key);
        }

        // Reading from HashBiMap
        /* read */ int value = biMap.get("key");
        System.out.println("BiMap Value: " + value);

        // Final operations on HashMultimap
        System.out.println("All Fruits: " + multiMap.get("fruit"));
        System.out.println("All Vegetables: " + multiMap.get("vegetable"));
    }
}
